The Art of Book Shuffling: A Study in Permutation

As an expert in tracking shuffled objects, I have analyzed the sequence of book exchanges among the five friends. To determine the final distribution of books, we must follow the sequence of swaps:

1. Alice and Bob swap books.
2. Eve and Bob swap books.
3. Bob and Claire swap books.
4. Alice and Claire swap books.
5. Dave and Claire swap books.

Using the fundamental principles of combinatorics, we can track the movement of each book. Let's represent the initial distribution of books as a set:

A = {The Great Gatsby}, B = {The Odyssey}, C = {The Fellowship of the Ring}, D = {Moby Dick}, E = {Lolita}

After the first swap, Alice and Bob exchange books, resulting in:

A = {The Odyssey}, B = {The Great Gatsby}, C = {The Fellowship of the Ring}, D = {Moby Dick}, E = {Lolita}

Next, Eve and Bob swap books, yielding:

A = {The Odyssey}, B = {Lolita}, C = {The Fellowship of the Ring}, D = {Moby Dick}, E = {The Great Gatsby}

Then, Bob and Claire swap books, giving:

A = {The Odyssey}, B = {The Fellowship of the Ring}, C = {Lolita}, D = {Moby Dick}, E = {The Great Gatsby}

After that, Alice and Claire swap books, resulting in:

A = {Lolita}, B = {The Fellowship of the Ring}, C = {The Odyssey}, D = {Moby Dick}, E = {The Great Gatsby}

Finally, Dave and Claire swap books, leading to:

A = {Lolita}, B = {The Fellowship of the Ring}, C = {Moby Dick}, D = {The Odyssey}, E = {The Great Gatsby}

Therefore, at the end of the semester, Alice has Lolita. The correct answer is (D).
